    false,nt"url": null,nt"notes": "This dataset shows the average interest
    rates for U.S. Treasury securities for the most recent month compared with the same
    month of the previous year. The data is broken down by the various marketable and
    non-marketable securities. The summary page for the data provides links for monthly
    reports from 2001 through the current year. Average Interest Rates are calculated
    on the total unmatured interest-bearing debt. The average interest rates for total
    marketable, total non-marketable and total interest-bearing debt do not include
    the U.S. Treasury Inflation-Protected Securities.",nt"license_title": "License
